import Layout from './../components/Layout';
import LoginBox from './../components/LoginBox';


const Login = () => {
    return(
        <Layout>
            <div className="container">
                <LoginBox />
                <style jsx>
                    {`

                        .container {
                            width: 100%;
                            height: 100%;
                            display: flex;
                            justify-content: center;
                            align-items: center;
                            
                        }
                    
                    `}
                </style>
            </div>
            
        </Layout>
       
    )
}

export default Login;
